import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ShopPerformance = () => {
  const [shopData, setShopData] = useState({});

  useEffect(() => {
    axios.get('/api/shop-performance').then((response) => {
      setShopData(response.data);
    });
  }, []);

  return (
    <div>
      <h3>Shop Performance</h3>
      <p>Total GMV: ${shopData.totalGMV}</p>
      <p>Refund Rate: {shopData.refundRate}%</p>
      <p>Flash Sales Performance: {shopData.flashSales}</p>
    </div>
  );
};

export default ShopPerformance;
